import React from "react";
import { FC } from "react";
import Form from 'react-bootstrap/Form'
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import { AddressInfo } from '../../api/domain/address-info';
import { useState } from 'react';



export interface AddressInfoFormProps {
  addressInfo: AddressInfo;
}



export const AddressInfoForm: FC<AddressInfoFormProps> = ({addressInfo}) => {

const [city, setCity] = useState(addressInfo.city);
const [street, setStreet] = useState(addressInfo.street);
const [houseNumber, setHouseNumber] = useState(addressInfo.houseNumber);
const [idx, setIdx] = useState(addressInfo.idx);


    return(
        <>
            <h2>Адрес</h2>
    <Form>
  <Form.Group as={Row} controlId="formPlaintextCity">
    <Form.Label column sm="2">
      Город
    </Form.Label>
    <Col sm="10">
      <Form.Control   defaultValue={addressInfo.city} />
    </Col>
  </Form.Group>
  <Form.Group as={Row} controlId="formPlaintextStreet">
    <Form.Label column sm="2">
      Улица
    </Form.Label>
    <Col sm="10">
      <Form.Control   defaultValue={addressInfo.street}/>
    </Col>
  </Form.Group>
  <Form.Group as={Row} controlId="formPlaintextHouseNumber">
    <Form.Label column sm="2">
      Номер дома
    </Form.Label>
    <Col sm="10">
      <Form.Control   defaultValue={addressInfo.houseNumber} />
    </Col>
  </Form.Group>
  <Form.Group as={Row} controlId="formPlaintextIdx">
    <Form.Label column sm="2">
      Индекс
    </Form.Label>
    <Col sm="10">
      <Form.Control   defaultValue={addressInfo.idx} />
    </Col>
  </Form.Group>
</Form>
</>
    )

    }
